// frontend/src/components/TicketDisplay.js
import React from 'react';

function TicketDisplay({ ticketCount }) {
  return (
    <div>
      <h2>Available Tickets: {ticketCount}</h2>
    </div>
  );
}

export default TicketDisplay;
